import React from 'react';

export default function Home() {

    state = {
        make: '',
        model: ''
    }

    return (
        <div className="Home">
            <h1>{this.state.username}</h1>
            <p>Enter your name, and submit:</p>
            <form onSubmit={this.SubmitHandler}>
            <input
                type='text'
                placeholder='Make'
                onChange={this.makeHandler}
            />
            <input
                type='text'
                placeholder='Model'
                onChange={this.modelHandler}
            />
            <input
                type='submit'
            />
            </form>
        </div>
    );
};
